    <h1>Receta index</h1>

    <div class=\"container\">
        <div class=\"row\">
            <div  class=\"col-lg-9\"></div>
            <div class=\"col-lg-3\">
            <a href=\"{{ path('receta_new') }}\">Agregar Receta</a>
            </div>
        </div>
     </div>

    <table class=\"table table-striped table-bordered table-condensed\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Nombre_receta</th>
                <th>Dosis</th>
                <th>Acciones</th>
            </tr>
        </thead>
        <tbody>
        {% for recetum in recetas %}
            <tr>
                <td>{{ recetum.id }}</td>
                <td>{{ recetum.nombreReceta }}</td>
                <td>{{ recetum.dosis }}</td>
                <td>
                    <a href=\"{{ path('receta_show', {'id': recetum.id}) }}\">Mostrar</a>
                    <a href=\"{{ path('receta_edit', {'id': recetum.id}) }}\">Editar</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"4\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

{% endblock %}
